pragma solidity ^0.4.23;

/**
 * The Ballot contract does this and that...
 */
contract Ballot {
  // Cu? tri (Nguoi bo phieu)
  struct Voter {
    uint weight; // Trong so' bo phieu
    bool voted; // Check bo phieu chua?
    address delegate; // Uy? quyen cho nguoi khac
    uint vote; // phieu bau (giong nhu kieu bau so ai, ten phieu bau)
  }

  // De xuat' (Phieu bau)
  struct Proposal {
    bytes32 name; // Ten de xuat (phieu: Voter.vote)
    uint voteCount; // So' luong phieu bau
  }

  address public chairperson; // Chu? tich. (dia chi nguoi tao hop dong)

  // Define a dictionary voters, same same dictionary struct in python: voters = {addr1: voter1, addr2: voter2, addr3: boter3}
  mapping (address => Voter) public voters;

  // Luu de xuat (Proposal) duoi dang mang? (array)
  Proposal[] public proposals;

  // Constructor
  constructor (bytes32 proposalNames) public {
    chairperson = msg.sender; // Khoi tao chu tich la nguoi ky' hop dong (nguoi deploy)
    voters[chairperson].weight = 1; // Quyen luc chinh 1 (trong so la 1)

    // Khoi tao mang proposals duoi dang {name, voteCount} . voteCount: 0 (phieu bau ban dau)
    for (uint i = 0; i < proposalNames.length; i++) {
      proposals.push(Proposal({
        name: proposalNames[i],
        voteCount: 0
      }));
    }
  }

  // Trao quyen bo phieu cho cu tri
  function giveRightToVote(address voter) public {

    // require: kiem tra neu ko dung thi hop dong se cham dut
    require(
      (msg.sender == chairperson) && // Chu tich co the thuc hien dieu nay
      !voters[voter].voted &&        // Cu tri chua bo phieu
      (voters[voter].weight == 0)    // Cu tri co trong so la 0
    );

    voters[voter].weight = 1; // Trao quyen duoc bo phieu cho cu tri
  }

  // Uy? quyen cu tri cua minh cho nguoi khac
  function delegate(address to) public {
    Voter storage sender = voters[msg.sender];

    // Khong the chuyen bieu quyet (vote) cho chinh' minh
    require(to != msg.sender);

    // Thang dai dien bieu quyet (thang duoc uy quyen) cung co the duoc giao pho (uy quyen) cho thang khac
    // Tim thang dai dien bo phieu cuoi cung va chuyen quyen bieu quyet (delegate) cho thang cuoi cung nay.
    while (voters[to].delegate != address(0)) {
      to = voters[to].delegate;

      //
      require(to != msg.sender);
    }

    // Cac vote da duoc chuyen (uy thac) => danh dau la da bo? phieu (voted = true)
    sender.voted = true;
    sender.delegate = to;

    // Tao 1 doi tuong voter: delegate_ (cu tri duoc uy quyen uy quyen)
    Voter storage delegate_ = voters[to];

    if (delegate_.voted) {
      // Neu thang duoc uy quyen da bo phieu => tang so phieu bau chon + trong so cua thang uy quyen (weight = 0 or 1)
      proposals[delegate_.vote].voteCount += sender.weight;
    } else {
      delegate_.weight += sender.weight;
    }
  }

  // Bo? phieu (bao gom ca phieu duoc uy quyen)
  function vote(uint proposal) public {
    Voter storage sender = voters[msg.sender];

    // Check xem da bo phieu chua. Neu bo phieu roi thi cham dut hop dong.
    require(!sender.voted);

    sender.voted = true;
    sender.vote = proposal;

    // Neu proposal nam ngoai pham vi cua mang proposals thi se tu dong break va khoi phuc tat nhung thay doi (revert all changes).
    proposals[proposal].voteCount += sender.weight;

  }

  // Tinh toan de xuat chien thang dua vao phieu bau hien tai.
  function winningProposal() internal view
          returns (uint winningProposal_)
  {
    uint winningVoteCount = 0;

    for (uint p = 0; p < proposals.length; p++) {
      if (proposals[p].voteCount > winningVoteCount) {
        winningVoteCount = proposals[p].voteCount;
        winningProposal_ = p;
      }
    }
  }

  // Lay ten cua de xuat chien thang.
  function winnerName() public view
          returns (bytes32 winnerName_)
  {
    winnerName_ = proposals[winningProposal()].name;
  }
}
